import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { useState } from "react";
import SlideTwo from "./SlideTwo";
import FinalSlide from "./FinalSlide";

function SlideShow() {
  return (
    <div className="Container">
      <div className="card w-100 mx-auto mt-4" style={{ height: "800px",overflow: "hidden" }}>
        <div className="text-center mt-5">
          <h2>Testing</h2>
        </div>
        <div className="header text-center mt-4">i am there</div>
        <div className="Container">
          <div className="row py-5 justify-content-center">       
              <img src="/Testing/Test1_Tumor.jpg" style={{width:"900"}}></img>         
            
              <img src="/Testing/Test1_No_Tumor.jpg" style={{width:"900px"}}></img>
            
          </div>
        </div>
      </div>
    </div>
  );
}

export default SlideShow;
